import React, { Component} from 'react';
import $ from 'jquery';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCoffee } from '@fortawesome/free-solid-svg-icons'
import data from "../data"; 
class home extends Component{
    componentDidMount() {
        $(document).ready(function() {
            $( ".card" ).hover(
                function() {
                    $(this).addClass('shadow-lg').css('cursor', 'pointer'); 
                }, function() {
                    $(this).removeClass('shadow-lg');
                }
            );
        });
    }
    
    render(){
    
		return (
			<main role="main">
			<div className="container">
			 <h3>APIs & Services</h3>
			 <p>Access information on how to use Forget APIs and Services</p>
			 
			 <div className="row mb-4">
			 
			 
			 {
				data.ApiList.map((applist, i) => {
					return (
					 <div key={i}className="col-sm-6 py-2 col-lg-4">
					<div key={i}class="card h-100">
					<div key={i}class="card-body">
					<FontAwesomeIcon icon="check-square" />
					<h5 key={i}class="card-title">{applist.title}</h5>
					<p key={i} class="card-text">{applist.descriptions}</p>
					</div>
					<div class="card-footer mx-3">
					  <div class="icons">
						  <a href="#"><i class="fa fa-facebook"></i></a>
						  <a href="#"><i class="fa fa-twitter"></i></a>
						</div>
					<ul class="list-unstyled">
						<li><a key={i} href={applist.link}>Intro</a></li>
						<li><a key={i} href={applist.link}>Developer's guide</a></li>
						<li ><a key={i} href={applist.link}> API reference</a></li>
					</ul>
					
					</div>
					
					
					
					</div>
					</div>
					);
				})
			 }
			 </div>
			</div>
			</main>
		);
    }
}
export default home;
